import React from 'react';

const Projects = () => {
  return (
    <section className="projects-section p-6">
      <h2 className="text-2xl font-bold mb-4">Projects Section</h2>
      <p>This is the Projects component content.</p>
    </section>
  );
};

export default Projects;
